-- Name: auto_delete_album_if_empty(); Type: FUNCTION; Schema: multi_schema; Owner: danieltech
--

CREATE FUNCTION multi_schema.auto_delete_album_if_empty() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF NOT EXISTS (
        SELECT 1 FROM "multi_schema"."AlbumMedia"
        WHERE "album" = OLD."album"
    ) THEN 
        DELETE FROM "multi_schema"."Album"
        WHERE "album_id" = OLD."album";
    END IF;

    RETURN NULL;
END;
$$;


ALTER FUNCTION multi_schema.auto_delete_album_if_empty() OWNER TO danieltech;

--
-- Name: auto_delete_media_in_duplicate(); Type: FUNCTION; Schema: multi_schema; Owner: danieltech
--

CREATE FUNCTION multi_schema.auto_delete_media_in_duplicate() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    count_duplicate INTEGER;
BEGIN

    SELECT COUNT(*) INTO count_duplicate
    FROM multi_schema."Duplicate" 
    WHERE hash_code = OLD.hash_code;

    IF count_duplicate = 1 THEN
        DELETE FROM multi_schema."Duplicate" WHERE hash_code = OLD.hash_code;
    END IF;

    RETURN NULL;
END;
$$;


